    following corrections.  We maintain a separate Income Tax Checkoff account and,
    although these transactions were reported to the Kentucky Registry of Election
    Finance, we were not aware that the receipts and disbursements in this account
    must also be reported as Federal Funds.  Therefore, these corrections combine
